import React from "react";
import './table.css'

const Table = (props) => {
    let i = 0

    if (props.data.length > 0) {
        return <>
            <table idName="">
                <thead>
                    <tr>
                        {
                            Object.keys(props.data[0]).map(title => <>
                                <th key={title}>
                                    {title}
                                </th>
                            </>)
                        }
                    </tr>
                </thead>
                <tbody>
                    {
                        props.data.map(row => <>
                            <tr key={++i}>
                                {
                                    Object.keys(row).map(r => <>
                                        <td key={++i}>
                                            {i}
                                        </td>
                                    </>)
                                }
                            </tr>
                        </>)
                    }
                </tbody>
            </table>
        </>
    }
}


export default Table
